import React from 'react';

const Header = () => {
    return (
        <div>
            I want a <select name={"seBooks"} id={"seBooks"}>
            <option value={"fiction"}>Fiction</option>
            <option value={"nonFiction"}>Non-Fiction</option>
        </select>
            Best-selling book
        </div>
    );
};

export default Header;
